static const char __pyx_k_first_window_cmd_1_first_window[] = "first_window cmd+1 first_window";
static const char __pyx_k_first_window_smelly_mod_1_first[] = "first_window smelly_mod+1 first_window";
static const char __pyx_k_fmt_fg_red_bell_symbol_activity[] = "\"{fmt.fg.red}{bell_symbol}{activity_symbol}{fmt.fg.tab}{title}\"";
